import React from 'react';
import Cardlist from './Cardlist'
import robots from './robots'

const App = ()=>{
    return(
        <div>
            <h1>Robofriends</h1>
            <searchbox></searchbox>
            <Cardlist robots = {robots}></Cardlist>
        </div>
    )
};

export default App;
